    "LTI Version": "\u0e40\u0e27\u0e2d\u0e23\u0e4c\u0e0a\u0e31\u0e19 LTI",
    "LTI configuration data.": "\u0e02\u0e49\u0e2d\u0e21\u0e39\u0e25\u0e01\u0e32\u0e23\u0e01\u0e33\u0e2b\u0e19\u0e14\u0e04\u0e48\u0e32 LTI",
    "LTI configuration not found.": "\u0e44\u0e21\u0e48\u0e1e\u0e1a\u0e01\u0e32\u0e23\u0e01\u0e33\u0e2b\u0e19\u0e14\u0e04\u0e48\u0e32 LTI",
    "Login URL: ": "URL \u0e40\u0e02\u0e49\u0e32\u0e2a\u0e39\u0e48\u0e23\u0e30\u0e1a\u0e1a: ",
    "Missing LTI 1.3 authentication token.": "\u0e42\u0e17\u0e40\u0e04\u0e47\u0e19\u0e01\u0e32\u0e23\u0e15\u0e23\u0e27\u0e08\u0e2a\u0e2d\u0e1a\u0e2a\u0e34\u0e17\u0e18\u0e34\u0e4c LTI 1.3 \u0e2b\u0e32\u0e22\u0e44\u0e1b",
    "Modal Height": "\u0e04\u0e27\u0e32\u0e21\u0e2a\u0e39\u0e07\u0e02\u0e2d\u0e07\u0e01\u0e34\u0e23\u0e34\u0e22\u0e32\u0e0a\u0e48\u0e27\u0e22",
    "Modal Width": "\u0e04\u0e27\u0e32\u0e21\u0e01\u0e27\u0e49\u0e32\u0e07\u0e02\u0e2d\u0e07\u0e01\u0e34\u0e23\u0e34\u0e22\u0e32\u0e0a\u0e48\u0e27\u0e22",
    "No valid user id found in endpoint URL": "\u0e44\u0e21\u0e48\u0e1e\u0e1a\u0e23\u0e2b\u0e31\u0e2a\u0e1c\u0e39\u0e49\u0e43\u0e0a\u0e49\u0e17\u0e35\u0e48\u0e16\u0e39\u0e01\u0e15\u0e49\u0e2d\u0e07\u0e43\u0e19 URL \u0e1b\u0e25\u0e32\u0e22\u0e17\u0e32\u0e07",
    "OK": "\u0e15\u0e01\u0e25\u0e07",
